import { render } from '@testing-library/react';
import React, { useState } from 'react';
import './App.css';

let currentTitle = `The Movie List`;
const title = <h1 className="App-title">{currentTitle}</h1>;

const categories = <ol className="Categorie-list"><p>Popular</p><p>New Movies</p><p>Movies</p></ol>

class App extends React.Component{
  render() {
    this.state = {title: <h1 className="App-title">{currentTitle}</h1>}
    return (
      <div className="App">
        <header className="App-header">
          {title}
          <a
            className="App-link"
            href="https://themoviedb.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            List API
          </a>
          {categories}

        </header>
        <body className="App-body">

          <div className="Movie-list">

          </div>

        </body>
      </div>
    );
  }
}

export default App;
